import { StyleSheet } from "react-native";

const style = StyleSheet.create({

    image: {
        width: '100%',
        height: '100%',
    },
    container: {
        width: '100%',
        height: '100%',
        opacity: 0.3,
        backgroundColor: '#000000',
        position: 'absolute',
        justifyContent:'center'
    },
    containerTop: {
        width: '100%',
        height: '100%',
        position: 'absolute',
        justifyContent:'center'
    },
    header: {
        width: '100%',
        opacity: 0.8,
        position: 'absolute',
        bottom: 5,
        flexDirection: 'row',
        marginHorizontal: 8,
        height: 35,
        justifyContent: 'space-between',
        paddingHorizontal: 10,
        alignItems: 'center'
    },

})
export default style;
